 Thus, the list $f(f(1)),f(f(2)),f(f(3)),\ldots,f(f(9))$ also contains each number from 1 through 9 exactly once, and $$f(f(1))+f(f(2))+f(f(3))+\cdots+f(f(9)) = 1+2+3+\cdots+9 = \boxed{45}.$$
